CREATE DATABASE clinica_veterinaria DEFAULT CHARACTER SET utf8mb4 DEFAULT COLLATE utf8mb4_general_ci; -- Codificação de caracteres por padrão e Utilização dos caracteres que iremos utilizar

USE clinica_veterinaria;

CREATE TABLE produto (
    id_produto INT UNSIGNED NOT NULL AUTO_INCREMENT,
    medicamento CHAR(50) NULL,
    racao CHAR(50) NULL,
    produto_higiene CHAR(30) NULL,
    PRIMARY KEY (id_produto)
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE veterinario (
    id_veterinario INT UNSIGNED NOT NULL AUTO_INCREMENT,
    crmv INT UNIQUE NOT NULL,
    nome_veterinario CHAR(30) NOT NULL,
    especializacao ENUM('Clínica Médica','Cirurgia','Anestesiologia','Cardiologia','Dermatologia', 'Endocrinologia', 'Oftalmologia', 'Oncologia', 'Ortopedia', 'Patologia', 'Reprodução', 'Zootecnia') NOT NULL,
    email_veterinario CHAR(50) NOT NULL,
    telefone_veterinario CHAR(20) NOT NULL,
    PRIMARY KEY (id_veterinario)
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE historico_medico (
    id_historico_medico INT UNSIGNED NOT NULL AUTO_INCREMENT,
    alergia ENUM('Y', 'N') NOT NULL,
    ultima_consulta DATETIME NOT NULL,
    PRIMARY KEY (id_historico_medico)
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE servico (
    id_servico INT UNSIGNED NOT NULL AUTO_INCREMENT,
    id_produto_servico INT UNSIGNED NOT NULL,
    tipo_consulta ENUM('Consulta de rotina', 'Consulta de emergência', 'Consulta especializada', 'Consulta de reavaliação', 'Consulta comportamental') NOT NULL,
    tipo_exame ENUM('Hemograma', 'Urinálise', 'Fezes', 'Radiografia', 'Ultrassonografia', 'Eletrocardiograma', 'Endoscopia', 'Biópsia', 'Teste de alergia') NOT NULL,
    tipo_cirurgia ENUM('Castração', 'Cirurgia ortopédica', 'Cirurgia de tecidos moles', 'Cirurgia emergência', 'Cirurgia odontológica', 'Cirurgia Cardiáca', 'Cirurgia oftalmologia', 'Cirurgia de caldas e orelhas') NULL,
    internacao ENUM('Y', 'N') NULL,
    banho_tosa ENUM('Y', 'N') NULL,
	hospedagem ENUM('Y', 'N') NULL,
	PRIMARY KEY (id_servico),
	FOREIGN KEY (id_produto_servico) REFERENCES produto(id_produto) ON DELETE RESTRICT
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE consulta (
    id_consulta INT UNSIGNED NOT NULL AUTO_INCREMENT,
    id_veterinario_consulta INT UNSIGNED NOT NULL,
    id_servico_consulta INT UNSIGNED NOT NULL,
    dt_hora DATETIME NOT NULL,
    PRIMARY KEY (id_consulta),
    FOREIGN KEY (id_veterinario_consulta) REFERENCES veterinario(id_veterinario) ON DELETE RESTRICT,
    FOREIGN KEY (id_servico_consulta) REFERENCES servico(id_servico) ON DELETE RESTRICT
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE animal (
    id_animal INT UNSIGNED NOT NULL AUTO_INCREMENT,
    id_consulta_animal INT UNSIGNED NOT NULL,
    id_historico_medico_animal INT UNSIGNED NOT NULL,
    nome_animal CHAR(30) NOT NULL,
    especie ENUM('gato', 'cachorro', 'porquinho da índia', 'peixe', 'passáros') NOT NULL,
    raca CHAR(30) NULL,
    idade INT2 NOT NULL,
    peso FLOAT NOT NULL,
    genero ENUM('M', 'F') NOT NULL,
    PRIMARY KEY (id_animal),
    FOREIGN KEY (id_consulta_animal) REFERENCES consulta(id_consulta) ON DELETE RESTRICT,
    FOREIGN KEY (id_historico_medico_animal) REFERENCES historico_medico(id_historico_medico) ON  DELETE RESTRICT
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE cliente (
    id_cliente INT UNSIGNED NOT NULL AUTO_INCREMENT,
    id_animal_cliente INT UNSIGNED NOT NULL,
    nome_cliente CHAR(30) NOT NULL,
    telefone_cliente CHAR(25) NOT NULL,
    email_cliente CHAR(50) NOT NULL,
    logradouro CHAR(50) NOT NULL,
    cep CHAR(20) NOT NULL,
    relacao_animal ENUM('Dono', 'Tutor', 'Responsável'),
    PRIMARY KEY (id_cliente),
    FOREIGN KEY (id_animal_cliente) REFERENCES animal(id_animal) ON DELETE RESTRICT
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;

CREATE TABLE concluir_recomendar (
	id_veterinario INT UNSIGNED,
	id_servico INT UNSIGNED,
	dt_servico_realizado DATETIME NOT NULL,
	FOREIGN KEY (id_veterinario) REFERENCES veterinario(id_veterinario) ON DELETE RESTRICT,
	FOREIGN KEY (id_servico) REFERENCES servico(id_servico) ON DELETE RESTRICT
) DEFAULT CHARSET=utf8mb4 ENGINE=INNODB;


