-- View veterinario_servicos_realizados: Esta view exibe o nome do veterinário, o tipo de serviço realizado e a data em que o serviço foi realizado.
CREATE VIEW veterinario_servicos_realizados AS
SELECT v.nome_veterinario, s.tipo_consulta, cr.dt_servico_realizado
FROM concluir_recomendar cr
INNER JOIN servico s ON cr.id_servico = s.id_servico
INNER JOIN veterinario v ON cr.id_veterinario = v.id_veterinario;

-- View animal_cliente: Esta view exibe o nome do animal, a espécie, a raça, o nome do dono do animal e o telefone do dono.
CREATE VIEW animal_cliente AS
SELECT a.nome_animal, a.especie, a.raca, c.nome_cliente, c.telefone_cliente
FROM animal a
INNER JOIN cliente c ON a.id_animal = c.id_animal_cliente;

-- View historico_medico_animal: Esta view exibe o nome do animal, a espécie, a raça, a idade, o peso e a data da última consulta.
CREATE VIEW historico_medico_animal AS
SELECT a.nome_animal, a.especie, a.raca, a.idade, a.peso, hm.ultima_consulta
FROM animal a
INNER JOIN historico_medico hm ON a.id_historico_medico_animal = hm.id_historico_medico
INNER JOIN consulta c ON a.id_consulta_animal = c.id_consulta
ORDER BY hm.ultima_consulta DESC;

-- View servicos_animal: Esta view exibe o nome do animal, a espécie, o tipo de serviço realizado e a data em que o serviço foi realizado.
CREATE VIEW servicos_animal AS
SELECT a.nome_animal, a.especie, s.tipo_consulta, cr.dt_servico_realizado
FROM concluir_recomendar cr
INNER JOIN servico s ON cr.id_servico = s.id_servico
INNER JOIN consulta c ON cr.id_servico = c.id_servico_consulta
INNER JOIN animal a ON c.id_consulta = a.id_consulta_animal;

-- View top_especialidades: Esta view exibe as especialidades dos veterinários com mais de 3 serviços realizados.
CREATE VIEW top_especialidades AS
SELECT v.especializacao, COUNT(*) AS total_servicos
FROM concluir_recomendar cr
INNER JOIN veterinario v ON cr.id_veterinario = v.id_veterinario
GROUP BY v.especializacao
HAVING COUNT(*) > 3
ORDER BY COUNT(*) DESC;

