-- Função - Adicionar um produto:
DELIMITER $$
CREATE FUNCTION adicionar_produto(
    p_medicamento CHAR(50),
    p_racao CHAR(50),
    p_produto_higiene CHAR(30)
)
RETURNS INT UNSIGNED
BEGIN
    DECLARE produto_id INT UNSIGNED;

    VALUES (p_medicamento, p_racao, p_produto_higiene);

    SET produto_id = LAST_INSERT_ID();

    RETURN produto_id;
END$$
DELIMITER ;

-- Função - Adicionar um veterinário:
DELIMITER $$
CREATE FUNCTION adicionar_veterinario(
    p_crmv INT,
    p_nome_veterinario CHAR(30),
    p_especializacao ENUM('Clínica Médica','Cirurgia','Anestesiologia','Cardiologia','Dermatologia', 'Endocrinologia', 'Oftalmologia', 'Oncologia', 'Ortopedia', 'Patologia', 'Reprodução', 'Zootecnia'),
    p_email_veterinario CHAR(50),
    p_telefone_veterinario CHAR(20)
)
RETURNS INT UNSIGNED
BEGIN
    DECLARE veterinario_id INT UNSIGNED;

    VALUES (p_crmv, p_nome_veterinario, p_especializacao, p_email_veterinario, p_telefone_veterinario);

    SET veterinario_id = LAST_INSERT_ID();

    RETURN veterinario_id;
END$$
DELIMITER ;

-- Função - Adicionar uma consulta:
DELIMITER $$
CREATE FUNCTION agendar_consulta(
    p_id_veterinario INT UNSIGNED,
    p_id_servico INT UNSIGNED,
    p_dt_hora DATETIME
)
RETURNS INT UNSIGNED
BEGIN
    DECLARE consulta_id INT UNSIGNED;

    VALUES (p_id_veterinario, p_id_servico, p_dt_hora);

    SET consulta_id = LAST_INSERT_ID();

    RETURN consulta_id;
END$$
DELIMITER ;

-- Função - Adicionar um cliente:
DELIMITER $$
CREATE FUNCTION adicionar_cliente(
    p_id_animal_cliente INT UNSIGNED,
    p_nome_cliente CHAR(30),
    p_telefone_cliente CHAR(25),
    p_email_cliente CHAR(50),
    p_logradouro CHAR(50),
    p_cep CHAR(20),
    p_relacao_animal ENUM('Dono', 'Tutor', 'Responsável')
)
RETURNS INT UNSIGNED
BEGIN
    DECLARE cliente_id INT UNSIGNED;

    VALUES (p_id_animal_cliente, p_nome_cliente, p_telefone_cliente, p_email_cliente, p_logradouro, p_cep, p_relacao_animal);

    SET cliente_id = LAST_INSERT_ID();

    RETURN cliente_id;
END$$
DELIMITER ;

-- Criação do usuário com permissão apenas de leitura
CREATE USER 'usuario_leitura'@'localhost' IDENTIFIED BY 'senha123'; -- Cria um novo usuário chamado 'usuario_leitura' com a senha 'senha123'
GRANT SELECT ON clinica_veterinaria.* TO 'usuario_leitura'@'localhost'; -- Concede ao usuário 'usuario_leitura' permissão de leitura em todas as tabelas do banco de dados 'clinica_veterinaria'
REVOKE DELETE ON clinica_veterinaria.* FROM 'usuario_leitura'@'localhost'; -- Remove a permissão de deleção que é concedida por padrão para usuários com permissão de leitura

-- Criação do usuário com permissão de leitura, inserção e modificação de dados
CREATE USER 'usuario_modificacao'@'localhost' IDENTIFIED BY 'outrasenha456'; -- Cria um novo usuário chamado 'usuario_modificacao' com a senha 'outrasenha456'
GRANT SELECT, INSERT, UPDATE ON clinica_veterinaria.* TO 'usuario_modificacao'@'localhost'; -- Concede ao usuário 'usuario_modificacao' permissão de leitura, inserção e modificação de dados em todas as tabelas do banco de dados 'clinica_veterinaria'
REVOKE DELETE ON clinica_veterinaria.* FROM 'usuario_modificacao'@'localhost'; -- Remove a permissão de deleção que é concedida por padrão para usuários com permissão de modificação

/* As sentenças SQL acima criam dois usuários distintos e concedem as permissões solicitadas para cada um deles. 
O primeiro usuário, 'usuario_leitura', tem apenas permissão de leitura em todas as tabelas do banco de dados 'clinica_veterinaria', 
enquanto o segundo usuário, 'usuario_modificacao', tem permissão de leitura, inserção e modificação de dados em todas as tabelas. 
Nenhum dos usuários tem permissão de deleção de registros em qualquer tabela do banco de dados. 
Além disso, foram adicionados comentários explicativos em cada sentença SQL para facilitar a compreensão das ações realizadas. */

-- Excluir em cascata, pois o id_produto é chave estrangeira em outras tabelas
ALTER TABLE servico
DROP FOREIGN KEY servico_ibfk_1;

ALTER TABLE servico
ADD CONSTRAINT servico_ibfk_1
FOREIGN KEY (id_produto_servico)
REFERENCES produto(id_produto)
ON DELETE CASCADE;

-- Para a tabela "produto"
START TRANSACTION;
-- Excluindo dois registros
DELETE FROM produto WHERE id_produto IN (1, 2);
-- Inserindo dois novos registros
-- Rollback
ROLLBACK;
-- Commit
COMMIT;

-- Para a tabela "veterinario"
START TRANSACTION;
-- Inserindo oito novos registros
-- Adicionando um Savepoint após a inserção do quarto registro
SAVEPOINT quarto_registro;
-- Inserindo mais quatro registros
-- Adicionando outro Savepoint após a inserção do oitavo registro
SAVEPOINT oitavo_registro;
-- Adicionando sentença comentada para eliminar o savepoint dos primeiros quatro registros inseridos
-- ROLLBACK TO quarto_registro;
-- Commit
COMMIT;

